function MainAccComponent(props) {

    const [ user, setUser ] = useState(null);

    useEffect(() => {
        setUser(props.user);
        //console.log("body user: " + JSON.stringify(user, null, 3));
    }, [props.user]);

    return(
        <div className="container-fluid">
        </div>
    );
}

